package rpc;

message GodBlessPlayerInfo
{
	required string name = 1;
	required string accountId = 2;
}

message GodBlessPlayerList
{
	required int32 level = 1;
	repeated GodBlessPlayerInfo players = 2;
}

message GodBlessInfo
{
	required int32 saveTime = 1;
	repeated GodBlessPlayerList  list = 2;
}

message MaxNutritionList
{
	required int32 level = 1;
	required int32 saveTime = 2;
	repeated GodBlessPlayerInfo players = 3;
}
